  true,\n\t\"url\": null,\n\t\"notes\": \"<p>A fee schedule is a complete listing
  of fees used by Medicare to pay doctors or other providers-suppliers.  This comprehensive
  listing of fee maximums is used to reimburse a physician and or other providers
  on a fee-for-service basis.  CMS develops fee schedules for physicians, ambulance
  services, clinical laboratory services, and durable medical equipment, prosthetics,
  orthotics, and supplies.  See Related Links below for information about each specific
  fee schedule.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
